const User = require('../models/User');

// 徽章静态配置（英文描述 + 逻辑）
const BADGE_DEFINITIONS = [
  {
    id: 'active_star',
    name: 'Active Star',
    icon: 'data:image/png;base64,',
    description: 'Awarded for completing 10 logins',
    condition: { 
      type: 'loginCount', 
      threshold: 10,
      check: (user) => user.loginCount >= 10 
    }
  },
  {
    id: 'new_star',
    name: 'New Star',
    icon: 'data:image/png;base64,',
    description: 'Awarded for joining 5 groups',
    condition: { 
      type: 'groupJoinCount', 
      threshold: 5,
      check: (user) => user.groupJoinCount >= 5 
    }
  },
  {
    id: 'social_king',
    name: 'Social King',
    icon: 'data:image/png;base64,',
    description: 'Awarded for making 5 ratings',
    condition: { 
      type: 'ratingCount', 
      threshold: 5,
      check: (user) => user.ratingCount >= 5 
    }
  },
  {
    id: 'new_hat',
    name: 'New Hat',
    icon: 'data:image/jpeg;base64,',
    description: 'Awarded for completing first login',
    condition: { 
      type: 'firstLogin', 
      threshold: 1,
      check: (user) => user.loginCount >= 1 
    }
  },
  {
    id: 'hard_working_star',
    name: 'Hard-Working Star',
    icon: 'data:image/png;base64,',
    description: 'Awarded for joining 10 groups',
    condition: { 
      type: 'groupJoinCount', 
      threshold: 10,
      check: (user) => user.groupJoinCount >= 10 
    }
  }
];

class BadgeService {
  /**
   * 检查并解锁用户徽章
   * @param {Object} user - 用户文档
   * @param {string} activityType - 活动类型（login/groupJoin/rating）
   */
  static async checkAndAwardBadges(user, activityType) {
    const relevantBadges = BADGE_DEFINITIONS.filter(badge => 
      badge.condition.type.includes(activityType) || 
      (activityType === 'login' && badge.condition.type === 'firstLogin')
    );

    const unlockedBadges = relevantBadges.filter(badge => 
      badge.condition.check(user) && 
      !user.badges.some(b => b.badgeId === badge.id)
    );

    if (unlockedBadges.length > 0) {
      user.badges.push(...unlockedBadges.map(badge => ({
        badgeId: badge.id,
        awardedAt: new Date(),
        description: badge.description
      })));
      await user.save();
    }
  }
}

module.exports = {
  BadgeService,
  BADGE_DEFINITIONS // 暴露给其他模块使用
};